import React from "react";
import styled from "styled-components";
import cookie from "react-cookies";
import { NavLink as Link } from "react-router-dom";
import logo from "../../../assets/images/youtube.png";
import titleImage2 from "../../image/MainImage2.png";
import Logout from "../../image/Logout.png";

const Container = styled.div`
  width: 440px;
  height: 100vh;
  background-color: #ced8e0;
`;
const TitleBox = styled.div`
  width: 440px;
  display: flex;
  flex-direction: column;
  align-items: center;
  margin-bottom: 20px;
`;
const TitleImage = styled.img`
  width: 371px;
  height: 32px;
  margin: 48px auto 12px;
`;
const TitleImage2 = styled.img`
  width: 175px;
  height: 37px;
`;
const Menu = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;
const MenuTitle = styled.div`
  width: 370px;
  height: 40px;
  margin: 36px 0 13px;
  padding: 2px 0 2px 16px;
  box-sizing: border-box;
  background-color: #0f1333;
  color: white;
  font-size: 24px;
  font-weight: 700;
`;
const MenuTab = styled.a`
  width: 346px;
  height: 31px;
  font-size: 22px;
  padding: 0 0 2px 24px;
  margin-bottom: 5px;
  border-bottom: 1px solid #0f1333;
  color: #0f1333;
`;
const LogoutButton = styled.img`
  width: 177px;
  height: 51px;
  margin: 23px 0 0 37px;
  cursor: pointer;
`;

function Nav() {
  const logout = () => {
    if (window.confirm("Would you like to Sign out?")) {
      cookie.remove("user_token");
      document.location.href = "/";
    }
  };

  return (
    <Container>
      <TitleBox>
        <Link to="/">
          <TitleImage src={logo} />
        </Link>
        <TitleImage2 src={titleImage2} />
      </TitleBox>
      <Menu>
        <MenuTitle>PUMAUNIVERSE</MenuTitle>
        <MenuTab>
          <Link to="/emopreregister">회원정보 관리</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/emoonsiteregister">현장등록 관리</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/emologinhistory">로그인 이력</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/emologincount">로그인 횟수</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/emoviewingmachine">관람기종 이력</Link>
        </MenuTab>
        {/* <MenuTab>
          <Link to="/emosurveyhistory">설문조사 이력</Link>
        </MenuTab> */}
      </Menu>
      <Menu>
        <MenuTitle>DIMF 회원 계정 관리</MenuTitle>
        <MenuTab>
          <Link to="/preregister">사전등록 관리</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/onsiteregister">현장등록 관리</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/preconsulting">사전상담 예약 관리</Link>
        </MenuTab>
      </Menu>
      <Menu>
        <MenuTitle>DIMF 회원 계정 관리</MenuTitle>
        <MenuTab>
          <Link to="/loginhistory">로그인 이력</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/logincount">로그인 횟수</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/stamphistory">스탬프 이력</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/viewingmachine">관람기종 이력</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/surveyhistory">설문조사 이력</Link>
        </MenuTab>
        <MenuTab>
          <Link to="/eventhistory">이벤트 당첨 이력</Link>
        </MenuTab>
      </Menu>
      <LogoutButton src={Logout} onClick={() => logout()} />
    </Container>
  );
}

export default Nav;
